import supertest from 'supertest'
import {expect} from 'chai'
const request = supertest('https://gorest.co.in/public/v2/')

const TOKEN = 'c8e4bcfc7d8b7559c74e6addd51a7a0945ff6b13acf96ac28674016ba4a50333'

describe.only('User Posts',()=>{
   let post_id
    it('/posts',async()=>{

        const data = {"user": "Amb. Divakar Deshpande",
                      "user_id": "8260051",
                        "title":"My Title",
                         "body":"My Post Body"
                           }

        const res = await request.post('posts')
                 .set('Authorization',`Bearer ${TOKEN}`)
                  .send(data)
                  .then((res)=>{
                                   //expect(res.body).to.deep.include(data)
                                   expect(res.body).to.have.property('id');
                                   //expect(res.body.user_id).to.have.property(data.user_id);
                                    expect(res.body.title).to.eq(data.title);
                                     expect(res.body.name).to.eq(data.name);
                                   
                                   post_id = res.body.id
                                   console.log("Created POST ID is : -===>", post_id)
                  })
                           
    })


    
})

